width: 100%;
height: 100%;
padding: 30px;
display: flex;

`;
;


type Props = {}

const Layout = (props: Props) => {


    return (
        <Container>
            <Header />
            <Footer />
            <Outlet />
        </Container>
    )
}

export default Layout
